INSERT INTO `myphoto_faq` (`faq_id`, `faq_question`, `faq_answer`) VALUES
(4, 'dfgdf', 'gfdgdf'),
(5, 'Can you change the background of my photo?', 'Yes. We do. In most cases, we can find or create a free background image for you from our own image resources, e.g. beaches, gardens, rooms, walls, neon lights... So in most cases, you don\'\'\'\'t need to worry about background images. It is possible that sometimes we may not be able to find what you need (e.g. an empty sand road with a purple double-decker bus and a female driver smoking inside). In that case, we will contact you soon and you may need to upload the background image by yourself. '),
(6, 'Will you claim the copyright?', 'No, we do not claim any copyright to derivative retouched/edited images submitted by customers, and customers are always the only copyright owner.'),
(7, 'What kinds of photos do you accept?', 'We accept most kinds of myphototal photos with single file size under 100M. In details, we accept these photos:\r\n     - JPG, GIF, PNG photos\r\n     - Most RAW files (NEF, CR2, DNG...)\r\n     - TIFF and PSD files\r\nYour photos will be very safe in Myphotopicture. No third party can access your photos without your password. '),
(8, 'What can I do if I am unhappy with your work? ', 'Myphotopicture offers 100% satisfaction guarantee. If you are unhappy with the new photos, please follow these steps:\r\n1. Request free revision. The designer might have misunderstanding on your instructions at the beginning. Please request free revision and add additional instructions or explanations, which will help the designer to better understand your expectation and improve the work.\r\n2. If you are sure this designer can never be the one you seek, please tell us and we will ask another designer to work on your photos.\r\n3. If it still doesn\'\'\'\'t work out, please contact Customer Support with the your project name and any concerns you might have.'),
(9, 'How long do I need to wait for your work?', 'Above industry standard, we seriously provide turnaround guarantee from 24 to 48 hours based on the service you choose. If we fail to deliver in time, a full refund will be provided. ');
