(6, 'World\'s leading creative photo re-touching', '    Incredible turnaround as fast as 24 hours\r\n    Accept TIFF, PSD & RAW images (NEF, CR2, DNG)\r\n', 'Professional Photo Editing Services from', '    Incredible turnaround as fast as 24 hours\r\n    Accept TIFF, PSD & RAW images (NEF, CR2, DNG)\r\n', 'Why Retouching matters...', 'The secret of many of the world\'s most prolific commercial & fashion photographers & art directors\r\n                     is that they are meticulous about the retouching process because they understand how important it \r\n                     is to their style. Good creative retouching involves a complete understanding of the style of a\r\n                      photographer or art director, and that\'s why at Happy Finish relationships between clients & retouchers \r\n                      tend to build-up and last for many years.', 'What customers say about our photo editing services...', '\"Well this is it...I mean WOW! perfect...perfect...perfect. The background is also perfect - I\'m so dancin! You\'ve made me look beautiful (((hug))). \" Karen, UK \r\n\r\nExtremely impressed with your work. That was really fast and quality was above what I could have expected. Thank you! \" Ruth Bondurant, CA \r\n\r\n\"I was sooooooo delighted to see the new photo. that\'s exactly what I need Kudos to your service! Myphotopicture\" Susan Miller, Sacramento ', 2.99, '02092011183449upload_img.jpg', '02092011183449sumbit_instr.jpg', '02092011183449get_new_photo.jpg');
