(101, 'Suzi John', 'jsuzi324@gmail.com', '', 'Hi,\r\n\r\nActually i was searching for quality partners for link exchange and\r\nI found that you are posting high quality content on your website\r\nso I want to know if you are interested in exchanging link with our\r\nwebsite.\r\n\r\n\r\nIf you are interested to exchange the links, please send me the following \r\n\r\ndetails of your site:\r\n\r\nTitle, Url and Description \r\n\r\nI\'ll add your link  in the next 24 hours. As soon as it\'s ready, I\'ll send you a \r\n\r\nconfirmation email.\r\n\r\nWe\'d appreciate it if you place a link back to our site using the\r\nfollowing HTML code (just copy and paste it into your links page):\r\n\r\n---------------\r\n\r\n<a href=\"http://www.websitesdesigningcompany.co/websites-development.html/\">Website developement</a>\r\n\r\n---------------\r\n\r\nor you can use the following \r\n\r\n\r\n\r\nTitle :  Website developement\r\nUrl :    http://www.websitesdesigningcompany.co/websites-development.html\r\n\r\n\r\n\r\n\r\nWith best Regards,\r\nSuzi', ''),
