(13, 'Chris Woolley', 'Chris264@hotmail.co.uk', '', 'I have made an order with you (73315) and you have taken the 9.99 twice and i havent recieve confirmation that you have recieved my order.. I have the two transaction numbers from paypal if you need them. \r\n\r\nRegards \r\n\r\nChris Woolley', ''),
