(15, 'Claire', 'info@idesigndigital.co.uk', '', 'Hello,\r\n\r\nI\'m writing to enquire as to whether or not you\'d be interested in utilising my services at Photo Works Direct. I am a freelance retoucher / digital artist based in Suffolk and I am keen to collaborate with businesses and photographers on either a temporary or on-going basis. If you have an overflow of work to be done, I\'d love to get involved!\r\n\r\nAll my work is done in Photoshop CS5 and Lightroom and I offer a fast and budget friendly service to ensure you\'ll be happy with the images I produce for you.\r\n\r\nExamples of my work and my rates can be viewed at http://www.idesigndigital.co.uk/\r\n\r\nI look forward to hearing from you,\r\n\r\nKind Regards,\r\n\r\nClaire', ''),
(16, 'Hollie Shaper Lourie', 'hollieshaperlourie@gmail.com', '', 'Hi, I have some photos to retouch, shall I email them over with instructions? Would love to see samples and find out costs please. Its just simple retouching but I would like to use you soon for some restoration and other services too. Thank you. Website looks great. ', ''),
(17, 'Elinor Bell', 'elinor@thepurelynaturalcompany.co.uk', '', 'Hi, can you please tell me what the different levels offer for product photo retouching? The hover buttons on your sight don\'t seem to be working. Thanks, Elinor', ''),
