(19, 'Elinor Bell', 'elinor@thepurelynaturalcompany.co.uk', '', 'Hello I submitted a product photo for background removal on 15th Aug.  I was under the impression it is a 24 hour turnaround. I have more photos that I would like to submit after I receive the current one.  How lond can I expect the turnaround to be?  Also can you please advise me what the basic, advance and expert levels will give me.  The hove button isn\'t working.\r\nMany thanks, Elinor', ''),
(20, 'jordan shoes', 'slcvnf@gmail.com', '', 'Wow Kim! I have been struggling lately trying to find various approaches to post on my blogs. This helps tremendously and I appreciate your willingness to share your insights. I wish you peace, joy and success!\r\nhttp://ccdongman.uueasy.com/read.php?tid=433547', ''),
(21, 'Sikha Sinha', 'sinhasikha@ymail.com', '', 'Hi Sir/Madam\r\n\r\n\r\nI am Marketing Manager.\r\n\r\nWe have a SEO going for the following package: - \r\n\r\nMonthly Task and responsibilities: - \r\n\r\nPackage for 15 keywords:\r\n\r\n1. Keywords Analysis & Research\r\n2. 200 Manually Directory Submissions\r\n3. 90 Article Submissions (1 Articles Submit in 30 Top Directories)\r\n4. 10 Press Release Distributions (1 Press Release submit in 10 Sites)\r\n5. 4 Web2.0/Blog postings\r\n6. 30 Social Bookmarking Submissions\r\n7. 3 Unique Article writing (400+ words)\r\n8. 1 Press Release writing (350+ words)\r\n9. Keywords Mapping \r\n10. Keywords density check \r\n11. Content optimization\r\n12. Keywords proximity and frequency\r\n13. Title Tag changes suggestions\r\n14. Meta tags changes suggestions \r\n15. Alt tag changes suggestions\r\n16. HTML Site Map suggestions \r\n17. XML site map setup\r\n18. Anchor text optimization\r\n19. Interlinking suggestions\r\n20. Google analytics setup\r\n21. Weekly Work Report\r\n22. Monthly Ranking Report\r\n23. Monthly Full Detailed SEO Work Report in Excel\r\n\r\n\r\nNote: We send weekly report to each of our clients so that they can have regular updates on their website. Also, this shows that we work regularly on the website in a very elegant way.\r\n\r\nWe use only white hat SEO techniques for each website. \r\n\r\nPlease let us know in case you are interested.\r\n\r\n\r\nThanks & Regards,\r\nSikha Sinha\r\nMarketing Manager', ''),
(22, 'hiren', 'hirenpatel380.hp@gmail.com', '', 'hello sir\r\n\r\ni am hiren patel from india\r\nan i have 3years exprience of photo retouchng and Portrait enhasing..\r\nso please give work on line\r\ni except your all work reapectly and give high quality work..\r\n\r\nmy mobile number : +918866486015', ''),
(23, 'Dana Williams', 'Dana.williams@btinternet.con', '', 'I have 8 separate photos of children that I need the background changing to white, however I would also like them all put together to make a panoramic photograph (hard copy) is this something you can help me with?', ''),
(24, 'Nilesh gajjar', 'nileshgajjar3938@gmail.com', '', 'ear Sir,\r\n \r\nI am doing photo restoration & portrait retuch work with 7 years of experience. \r\nWith a small team of 3 people, I can handle upto 150 images a day and can expand capacity as required.\r\n\r\nI am ready to do sample work if you wish to test my skill.\r\n \r\nBest regards,\r\nwww.prasangfashion.in\r\nNilesh Gajjar', ''),
(25, 'shamim', 'asian.clippingpath@gmail.com', '', 'hi,\r\nwe are a team of graphics designers and we are editing any kind of images and our company have so many experience designers.\r\nand minimum of 3 years experience person are granted for our company.we are doing job in another company,then we thoughts\r\nwe are also started clipping business but some people of our company are cheated with us and they are taking away  our regular customer.so we are on a big presser because we  don\'t have no clients so we need job please give us job please.at least check\r\nour quality and i promise you do not pay for any kind of test job.we hear that you are the king of clipping and so many company are\r\nestablished because you support them. per day you are processed so many images  please gives some job and gives us a opportunity to build up our company level. i don\'t explained that how much i need job.please help us otherwise our company will finished within 2 or 3 months.please save us.\r\nour service\r\n1.clipping paths,\r\n2.images channel layer masking\r\n3.images cropping straight\r\n4.images resizing\r\n5.manipulation\r\n6. recoloring\r\n7.any kind of retouch\r\n8.shadow\r\n9.reflection\r\nand our images price is also cheap to another companies and our quality is the best quality.\r\nso sir please think about our little companies future on your hand.\r\n\r\n\r\nBest\r\nManaging director(image editors)', ''),
