(28, 'Shamim ', 'shamim@ccplbd.com', '', 'Dear Sir/Madam,\r\n\r\nWe would like to take this opportunity of briefly introducing Creativity Clipping Path Ltd. (CCPL), which is a well established company for the past One year, with business transactions being carrier out in Bangladesh as well as International. The company deals with a varied range of design namely  such as a pioneer Clipping Path Company in Bangladesh offering Photoshop Service Provider for Clipping Paths, Image Retouching, Photo Retouching, Image Masking, Photoshop Background Removal, Clipping Path, Alpha Channel Masking, Raster to Vector, Image Conversion Service, Photo Color Correction, Photo Colorization, Photo Manipulation, Image Manipulation, and Face Touchup and Silhouetting Services using Photoshop editing tools.\r\n\r\nThe name and business strength that has been earned by our organization today, is due to the professionally equipped and high motivated staff, who have a varied experience of the local & International market and good knowledge of serving the customers to their satisfaction. This is further enhanced by the innovative ideas of the management, who strive from time to time in creating awareness and keeping the company at par to the latest development of todays world.\r\n\r\nA concise summary of each of our divisions are mentioned here below, which are for your perusal. It would be highly appreciated if you could register our company name in your list of approved suppliers, for relevant business opportunities, so as to render our services to your esteemed selves in the foreseeable future.\r\n\r\nYour benefits :\r\n\r\n?    Low cost service\r\n?    No payment required before completion\r\n?    Quick turnaround\r\n?    Satisfaction guarantee\r\n?    Volume discount\r\n?    Triple check quality control\r\n?    24 hours customer support\r\n?    All types of photo treatment service available\r\n?    Easy and flexible services\r\n?    Huge amount of image processing capacity\r\n?    Service available 24/7- 365 days\r\n\r\nWe are requested to visit our website : www.ccplbd.com\r\n\r\nThanking you in anticipation,\r\n\r\n\r\nShamim Biswas\r\nCEO\r\nCreativity Clipping Path Ltd. (CCPL)\r\nMob : 8801925885953, 8801684257595\r\nE-mail : info@ccplbd.com, shamim@ccplbd.com\r\nSkype ID : asian.clippingpath\r\nWeb : www.ccplbd.com', ''),
(29, 'Abhishek Mishra', 'info.seo11@yahoo.com', '', 'Dear Sir\\Madam\r\n\r\nI am Marketing Manager.\r\n\r\nWe have a SEO going for the following package: - \r\n\r\nMonthly Task and responsibilities: - \r\n\r\n\r\nPackage For 15 Keywords:\r\n\r\n1. Keywords Analysis & Research\r\n2. 200 Manually Directory Submissions\r\n3. 90 Article Submissions (1 Articles Submit in 30 Top Directories)\r\n4. 10 Press Release Distributions (1 Press Release submit in 10 Sites)\r\n5. 4 Web2.0/Blog postings\r\n6. 30 Social Bookmarking Submissions\r\n7. 10 website themed links\r\n8. 3 Unique Article writing (400+ words)\r\n9. 1 Press Release writing (350+ words)\r\n10. Keywords Mapping \r\n11. Keywords density check \r\n12. Content optimization\r\n13. Keywords proximity and frequency\r\n14. Title Tag changes suggestions\r\n15. Meta tags changes suggestions \r\n16. Alt tag changes suggestions\r\n17. HTML Site Map suggestions \r\n18. XML site map setup\r\n19. Anchor text optimization\r\n20. Interlinking suggestions\r\n21. Google analytics setup\r\n22. Weekly Work Report\r\n23. Monthly Ranking Report\r\n24. Monthly Full Detailed SEO Work Report in Excel\r\n\r\n \r\nNote: We send weekly report to each of our clients so that they can have \r\n\r\nregular updates on their website. Also, this shows that we work regularly on \r\n\r\nthe website in a very elegant way.\r\n\r\nWe use only white hat SEO techniques for each website. \r\n\r\n\r\nPlease let us know in case you are interested.\r\n\r\nKinds & Regards\r\n\r\nAbhishek Mishra', ''),
(30, 'Shahadat Hossain Pramanik', 'info@clippingpathgoldensolve.com', '', 'GOLDEN SOLVE CENTER\r\ninfo@clippingpathgoldensolve.com\r\nwww.clippingpathgoldensolve.com\r\n\r\nDear Sir,\r\n\r\nI am Shahadat Hossain Pramanik,\r\n \r\nOutsourcing and photo editing Executive. We have over 5 years of experience, are one of the largest outsourcing and photo editing firms based in Indian Subcontinent.\r\n\r\nWe have a large team of Professionals who are expert in Quality photo editing, time consuming duties for you in half of your in-house resource cost. I would like to inform you that I have a quality assured company who has highly skilled personnel for providing the image editing services as;\r\n\r\n1. Clipping Path for removing the background or color change.\r\n2. Multiple Clipping Path for color change.\r\n3. Image Manipulation, i.e; neck joining, head or face replacing.\r\n4. Photoshop Masking.\r\n5. Drop/Natural Shadow making.\r\n6. Reflection or Mirror Effect making.\r\n7. Retouching for removing dust, spots and any other imperfections.\r\n8. Optimizing image for website uses.\r\n9. Data Entry Services.\r\n\r\nFor more information visit our website: www.clippingpathgoldensolve.com\r\n\r\nGetting started is easy. Just mail us at info@clippingpathgoldensolve.com    and we will definitely help you to achieve your business goals and objectives.\r\n\r\nWe are looking forward starting a long and healthy business relationship with you. I will really appreciate you please let me know your requirements.\r\n\r\n\r\n\r\nPlease feel free to write me if you have any questions or need further information.\r\nLook forward to your response and work with you soon.\r\n\r\n\r\nThanks,\r\n\r\nShahadat Hossain Pramanik\r\nCEO\r\nGolden Solve Center\r\ninfo@clippingpathgoldensolve.com\r\nwww.clippingpathgoldensolve.com\r\n\r\n\r\n', ''),
(31, 'Juan Garca Soler', 'juanragaso@thethinkingfactory.es', '', 'Hello. My English is not very good and I am using Google.\r\nI am contacting you to have a first contact and solicit Online retouching services.\r\n\r\nWe are looking for a serious and professional. If you want I can send them to your email a jpg with my project. Work is already in development.\r\n\r\nWe are a Spanish company and are building a printing shop. We want to add other services such as those with you; Photo Restoration, Photo Caricatures, Photo Manipulation.\r\n\r\nMy experience in digital retouching is important and can filter the jobs before they reach you. I tried to contact my former colleagues and industry do not seem to show much interest, is incredible with the crisis we have in Spain.\r\n\r\nFirst need to know if you are interested and see what would be the workflow.\r\nThe work that we might receive on our website is redirecionaran via email.\r\nFor payment we could see payment options or payment request and then weeks or fortnights.\r\n\r\nThank you very much in advance for your attention. Sincerely, Juan Ramn Garca Soler', ''),
(32, 'Niki', 'N.singh@financier.com', '', 'Hi, \r\nIm currently looking for a company I can use on a regular basis for any photographic editing or touch ups I require. I will have alot of different projects that may need your skills but firstly, \r\n \r\n I have some photos that were taken on an Iphone from a recent event I attended.\r\nUnfortunately it was only an Iphone 3GS and they haven\'t come out the best of quality.\r\nI was really looking to use them for website and content purposes and I wanted to know If I sent them over could you have a look?\r\nAn if you think there fix able send me over a price?    \r\n\r\nAny help you can offer would be much appreciated.\r\n\r\nNiki', ''),
(33, 'Manash Saha', 'manashbd@gmail.com', '', 'Dear Sir/Mam,\r\n\r\nHow are you ? Hope everything is fine.I think we could help your business. We are based in Bangladesh. We provide low cost high quality hand made Clipping Path, Masking, Retouch (Specially Clipping Path, Retouch & Wedding Photo Retouch).\r\nWe are working as a image editing service provider since last 5 years, We have a good Knowledge About all Photoshop tools.\r\nWe have our own production house, they are working hard to fulfill our clients Requirements; We Offer best quality, fast service in a very low price.\r\n\r\nAlso have a discount system for large volume of work and long term customers.\r\n\r\nWe are interested contract basis. If you have any work please feel free contact us or if you know Any Agency please refer us.\r\n\r\nWe are looking forward for a favorable response from you, If you want you can send us 3 test  Image for our quality check.\r\n-----\r\nHave a good day.\r\n\r\nThanks & Regards\r\nManash Saha\r\nGtalk ID: manashbd@gmail.com', ''),
(34, 'Ramon Elliot', 'ramonelliot2@gmail.com', '', 'You know how important it is to be visible.  You know you need to use the internet better.  But you also need to take care of your business.  You cant do both.  Well, you take care of your business well take care of the internet for you.  Our expert staff understands how to make search engines your friend.  Email us and well get started.', ''),
