(48, 'Hossain', 'info@clippinga1.com', '', '\r\n\r\nRespected Sir/Madam,\r\n\r\nI am writing from Clipping A1 services, which is a image editing base organization in Bangladesh. We are keen to provide our services to your company as a production unit. Our company provided to all the major service in Photoshop like Clipping path, Masking, Retouching, Vector Graphics, Color corrections etc.\r\n\r\nWe offer all kinds of for image editing & processing service in very reasonable service price. We are considered as the best by our clients and it would be an honor to provide our services to you. Please see the price table to know our rates and services.  \r\n\r\nPrice based on (USD $)                                                       \r\n\r\n \r\n\r\nDifficulty        Clipping      - masking     - manipulation  -  retouch -  color correction\r\n\r\n \r\n\r\nComplex 1 -      0.15               1.00               1.20                  0.80               0.75\r\n\r\nComplex 2 -      0.25               1.50        `      2.00                  1.50               1.20\r\n\r\nComplex 3 -      0.50               3.00                                        2.00               2.50\r\n\r\nComplex 4 -      0.90                                                              2.80               5.00\r\n\r\nComplex 5 -      1.50                                                              4.00\r\n\r\nComplex 6 -      2.50\r\n\r\nComplex 7 -      3.5/+\r\n\r\n \r\n\r\nNow a day most of the clipping service provider company have more than 2 or 3 production unit in different country, for this issue we want to join with some overseas company maybe we will serve in low cost but we need to globalization.\r\n\r\nRegarding our experience and skilled- first of all please send us some sample file for trial which we will do for test base, after check our quality of work then you will decided - agree or not to work with us. Our prices are extremely competitive and our quality & care is unparalleled