(50, 'Tony Howe', 'pr@arpictures.net', '', 'Dear Photoworks Direct,\r\n\r\nOnce the image has been retouched and sent back to me and I am satisfied with it. What does Photoworks Direct do with the image after that does it get destroyed or stored to be used at a later date? Is my copyright being protected?\r\nCan you only retouch work where I own the copyright?\r\n\r\nKind regards\r\n\r\nTony Howe\r\n', ''),
