(53, 'Hossain', 'info@clippinga1.com', '', 'Respected Sir/Madam,\r\nWe offer all kinds of image editing & processing service in very reasonable price. We are considered as the best by our clients and it would be an honor to provide our services to you. Visit us for more details about service and other issue.  www.clippinga1.com\r\nRegarding our experience and skilled- first of all please send us some sample file for trial which we will do for test base, after check our quality of work then you will decided - agree or not to work with us. Our prices are extremely competitive and our quality & care is unparalleled.\r\nFor any query please feel free to contact with us.\r\nHoping positive reply.\r\nYours sincerely,\r\nHossain\r\nwww.clippinga1.com\r\n', ''),
(54, 'David Hepple', 'davidhepple@doctors.org.uk', '', 'Hi, I have a photo I want some colour isolation on. It\'s a landscape with a small red flag in the centre. I\'d like the photo in B&W with flag the original colour - Is this something you can do?\r\n\r\nThanks\r\n\r\nDavid', ''),
(55, 'Hannah Delaney', 'hannah-delaney@hotmail.com', '', 'I would like an explanation from your company why I have not had an explanation or apology for the poor service you offer. I sent in two photos last week on Thursday which you claimed to not receive. I resent them on Saturday and receipt was confirmed by James Philip. I was told work would start on Monday 11th. I contacted yourselves on Monday to be told by James Philip that the work was underway and would be done by Tuesday or Wednesday. I have still heard nothing. What sort of service do you offer? Is this how your way of treating customers? Ignore them? \r\n', ''),
(56, 'Dan Trinidad', 'dan@freelancer.com', '', 'Hi,\r\n\r\nHope this finds you well.\r\n\r\nI manage advertising opportunities for Freelancer.com\r\n\r\nCan you get me in touch with someone who decides on your online marketing and advertising needs? I would like to know if you are interested in advertising your services and products on our website.\r\n\r\nLooking forward to your positive response.', ''),
(57, 'Linda Ely', 'linda@elyfamily.co.uk', '', 'I have submitted a project 35276 with two photos, but I\'m not sure it went in correctly.  Please contact me to make sure that you understand the direction.  Many thanks.  ', ''),
(58, 'Michaela Waddell', 'michaelawaddell@mac.com', '', 'Hi  Hope you can help, have just created an account as would llike to try out your service, have uploaded an image a couple of times, but doesn\'t take me to the continue button.\r\n\r\nCan someone help, thank you.\r\n\r\nMichaela', ''),
(59, 'Max', 'mmmmax@gmail.com', '', 'I have a lot of photos of grocery items, something on the order of 3,000. I would like to have them cut out of their mostly white background and set on pure white. Basic product retouching. Price is the primary factor, followed by speed. Here is an example of before and after that I\'m looking for...\r\n\r\nBefore: https://www.dropbox.com/s/1n6otrx8i97y4cz/4698.jpg\r\n\r\nAfter: https://www.dropbox.com/s/h9pfycxqs8m34mo/4698.png\r\n\r\nEach image needs to be delivered as a PSD with the original image and a path, with white everywhere else. In addition, we need a 1000px PNG file for each image output.\r\n\r\nCan you guys offer me a quote for 3,000 images?', ''),
