(64, 'Ramon Elliot', 're.ramonelliot@gmail.com', '', 'You know how important it is to be visible. You know you need to use the internet better. But you also need to take care of your business. You cant do both. Well, you take care of your business well take care of the internet for you. Our expert staff understands how to make search engines your friend. Email us and well get started.', ''),
(65, 'vajubhai', 'parthprofessionalphoto@rediffmail.com', '', 'Respected Sir,\r\ni am a professional photographer, i have own photo studio in india (state:- gujarat). it\'s working since last 22 years.\r\ni\'m presently working with all the type of photo-editing marrage album design & special photo restoration of\r\ninternational level. if you would like to work with me then you can contact me on below e-mail address.\r\nnow, i am talking about the working method:: you have to just send me your customer\'s work (interms \r\nof photo restoration, editing etc) &(by correcing it) i will send back it to you by same way & for that you\r\nhave to pay to me i am attaching some of the restored photo with this e-mail. i had edited only some of \r\nthe information, if you have any query regarding this information then you ask to me. you have to send me the \r\ndetail of work & prize list also. hoping for your positive responce.\r\nmy e-mail addres - parthprofessionalphoto@gmail.com , parthprofessionalphoto@rediffmail.com\r\nmy name is vajubhai badhiya 37 m. year old  Light and color correction;\r\n    Removing scratches, noise, camera matrix defects;\r\n    Changing background according to customers requirements;\r\n    Artistic Photo Manipulation (Fantasy)\r\n    Image Manipulation for Advertising.\r\n    Add lens effects, shine and brilliance;\r\n    Adjusting gems to make the look more real;\r\n    Body shape correction; Body sculpting.\r\n    Lights and color adjusting;\r\n    Image Crop: Trim portions of your photo.\r\n    Restoration of any kind of old photos;\r\n    Basic Photo Reduction: Reduce the size of your photo for uploading to websites and printing.\r\n    Object Removal: Remove unwanted objects from your photo.\r\n    Object Additions: Add objects to your photo.\r\n    Eye Enhancement: Remove eye baggage, enhance eye color.\r\n    Red Eye removal: Remove Red Eye from your photo.\r\n    Teeth Whitening: Make those teeth shine in your photos!\r\n    Hair Lightening: Change or enhance the color of hair in your photographs.\r\n    Skin Coloration: Lighten or Darken skin tones.\r\n    Text Addition: Add text to your photo.\r\n    Black & White: Change any photo from color to Black and White for a classic photography look.\r\n    Sepia Tone: Giving your photo the timeless sepia tone look.\r\n    Colorization and restoration of old black and white images. Or enhancing the color of your photo.\r\n    Adding People to Photo: Add that missing person to your family photo!\r\n    Removing People from Photo : Remove that unwanted person from your photo (passer bys, unwanted   gestures, etc)\r\n    Any other work on customers demand.\r\n', ''),
(66, 'Lais', 'lais@pontescollection.com', '', 'Hello, \r\n\r\nI hope this email reaches you well. \r\n\r\nI am writing in regards to your photoshop services. \r\n\r\nWithin the next month I will have 26 products shots (jewelry) that I will need color corrected and on a transparent background. \r\n\r\nDepending on the price  may do 2 different shots of each product (total of 52 images). \r\n\r\nThe jewelry is sterling silver with gemstones  nothing too intricate. \r\n\r\nCan you please send me your rates?\r\n\r\nI would like to find someone before the samples come out of production. \r\n\r\nThat way once they are photographer I can get the ball rolling ASAP. \r\n\r\nThanks!\r\n-Lais ', ''),
(67, 'kairi', 'kairimae@hotmail.co.uk', '', 'I have pictures of myself, my husband, my mother, my father, my younger brother and also in one or two my grandmother is included. Is there anyway to make a family photograph out of these- of just my parents, my brother and my husband and I into one photograph please? I have one of my brother, mother & father but my father is pulling a face and my mothers eyes are closed, its in a restaurant, but its the most recent I have of them together. The most recent of my husband and I was taken on the same day in the same restaurant and we both are smiling/laughing in it. Also Id like it retouched, double chins removed on my father & husband, remove any wrinkles or acne or blemishes and shadows etc, also merge the photos together to make them look as one portrait. Also can you make my mother look slightly slimmer in her face and retouch her, as she hates herself in photos! How much would this cost please? Thank you so much for any help :)', ''),
(68, 'kairi', 'kairimae@hotmail.co.uk', '', 'I have pictures of myself, my husband, my mother, my father, my younger brother and also in one or two my grandmother is included. Is there anyway to make a family photograph out of these- of just my parents, my brother and my husband and I into one photograph please? I have one of my brother, mother & father but my father is pulling a face and my mothers eyes are closed, its in a restaurant, but its the most recent I have of them together. The most recent of my husband and I was taken on the same day in the same restaurant and we both are smiling/laughing in it. Also Id like it retouched, double chins removed on my father & husband, remove any wrinkles or acne or blemishes and shadows etc, also merge the photos together to make them look as one portrait. Also can you make my mother look slightly slimmer in her face and retouch her, as she hates herself in photos! How much would this cost please? Thank you so much for any help :)', ''),
(69, 'samantha kara', 'samantha446@hotmail.co.uk', '', 'im trying to register to pay for the photo fix and enhance and its not letting me do that can you please give me a call back because im interested with registering with your company', ''),
(70, 'Rajeswari Murukesan', 'rajeswari.murukesan@gmail.com', '', 'Dear Sir / Madam\r\n\r\nI would like to know if you do a full person colour caricature. I want it done for one person to present it as a gift. Could you tell me the price with P&P please?\r\n\r\nThanks\r\nRajee', ''),
(71, 'Rachelle', 'Rachell@myleor.co.uk', '', 'Hello,\r\n\r\nI\'m interested in your photo retouching service for some product photos I\'ve had taken. I need the background changed to white and I have about 20 images. What would your turn around time be on getting these images completed?\r\n\r\nThank you!', ''),
