(73, 'Katherine Wilson', 'katelinglis@gmail.com', '', 'Hi,\r\nI have a few wedding photos that I was wanting retouched or manipulated slightly and was wondering if it was achievable and how much it would cost.\r\n\r\n3 group photos where the end person looks slightly removed frm the group and I\'d like them just moved in slightly closer (bunch the group up a little).\r\n\r\n1 photo where the sunlight is very bright in one place and I was wondering if it can be calmed down a little?\r\n\r\n1 photo where I have a stray bit of hair I\'d like removed.\r\n\r\n1 photo with a person I\'d like a person removed.\r\n\r\nIs this possible and roughly how much would it cost?\r\n Is there the possiblility to review the edits before paying?\r\nRoughly how long will the edits take?\r\n\r\nMany thanks', ''),
(74, 'Mr.Rubel', 'info@skyviewclippingpath.com', '', '\r\nDear valued client,\r\n \r\nHope you are doing well.\r\n \r\nPlease check our website: http://www.skyviewclippingpath.com\r\n \r\nWith due respect that we would like to inform you that we are image processing,multimedia and graphics design outsourcing company based in Dhaka,Bangladesh.Specially experts in clipping path,masking, retouching, drop shadow, nick fill ,color correction,changing background, photo resizing,image manipulation,restoration and all kinds of Photoshop services.\r\n\r\nWe have seen your work  great presentation, fabulous work on your website by google search.\r\n \r\nWe request you to send us 3 test files along with instructions. (Free Services)\r\n\r\nYou may send test file via www.sendspace.com OR mailbigfile.com\r\n \r\nLater on for work, we would provide you a separate FTP account.\r\n \r\nWe have specialized designers who have been working in  this fields since five years.\r\n.\r\nWe offer ridiculously low price and quick turnaround time.\r\n\r\nWe provide in all formats JPEG, Tiff, PSD.\r\n \r\nWe work on all files formats including raw files, cr2 files.\r\n \r\nWe work on 24hours turnaround time.\r\n \r\nPrice is indicative and purely negotiable. Prices  depend on the nature of work and volume of work.\r\n \r\nWe accept Payment through PayPal.\r\n\r\nNow if you think we are right for core part of your business then please send us some test jobs for testing our quality.\r\n \r\nIf you have any queries, please feel free to write us.\r\n \r\nWe are available 24hours online on skype\r\nSkype id: skyviewclippingpath\r\n\r\n', ''),
(75, 'Brijesh', 'amroxart@gmail.com', '', 'Hello Sir/Madam,\r\n\r\n      Photo Restoration, photo Retouching.\r\n\r\n     I Have 7 Years Experience In This Field.\r\nIf You Can Interesting To Work With Me,Please\r\nReplay Us.\r\n\r\n      flat price Any Photo,$- 2.50 any Photo	\r\n      we Have Large Production Capacity, per Day 200 to 500\r\n      Satisfaction Guaranteed,\r\n      24 hour work back Guaranteed,\r\n\r\nBest Regards,\r\n\r\nwww.amroxart.com\r\n\r\nAMROXART', ''),
(76, 'Richard ', 'richbagnold@gmail.com', '', 'Hi - would you be able to alter a photo to take in the outer line of a shirt to make someone look slightly thinner and replace with background / a continuation of a small sillouette? How much would this cost if so? \r\n\r\nThank you', ''),
(77, 'Nicole Paolello', 'nicolepaolello@gmail.com', '', 'Hi, I have some product shots where I have some wrinkled  fabric that I used as a backdrop (as an amature mistake). I would like to know if the creases could be removed and have it still look natural? I\'ve tried to do it myself but I\'m so busy and this would take me some time.', ''),
(78, 'Kevin jackson', 'k.jackson28@hotmail.com', '', 'I got engaged last year and I had we had our photo taken to remember the moment but the gentlemen who took our photo, focused on the background rather than us. I was wondering if you could make us the fosuc rather than the forground. Kind regards\r\n\r\nKevin Jackson', ''),
