(80, 'sudish kumar sah', 'snapedgezone@gmail.com', '', 'Dear Sir,\r\n\r\n\r\n\r\nWe were in search of a good company for the business deal. We came to know about your company from the Google. At first we would like to introduce us.\r\nWe are snapedgezone.com. located in Delhi, India. Our company has been established before 4 years. From the starting phase to now we are doing lots of progress and facilitating the clients with affordable quality and quantity. Actually we deal about image to Photoshop .i.e. image to psd job which includes the services of image and its manipulation.\r\nOur services are:-\r\n\r\n1. Image clipping path\r\n2. Background removing\r\n3. Image masking\r\n4. Image retouching\r\n5. Colour correction\r\n\r\nWe can easily perform the jobs with best quality regarding the suitable deadline regarding the jobs provided by clients at the affordable rate of clients and we never compromise in the quality and take care of deadline.\r\nWe hope to build the best business relationship. Hence we would like to consider our offer positively to work with you and your company keeping longtime relationship for your generosity. We will remain ever greatful to you.\r\nThank you,\r\n\r\nWaiting for your early response.\r\n\r\n\r\n\r\nRegards,\r\nSnapedgezone Teem\r\n\r\n\r\n\r\nContact Office :\r\n\r\nMarketing Head	\r\nNew Delhi-46, India\r\nMobile  : + 91 9968104292\r\nOffice   : + 91 28524811\r\n             : + 91 8526947001\r\n             : + 91 8526947002\r\nSKYPE : snapedgezone \r\nEmail    : snapedgezone@gmail.com\r\nG-talk   : snapedgezone@gmail.com\r\nWeb     : www.Snapedgezone.com\r\n\r\n\r\n     \r\n', ''),
