(82, 'Mukesh Tiwari', 'mukeshhello7@gmail.com', '', ' \r\n\r\n \r\n\r\nHello,\r\n\r\nWelcome to the world of  Digital Restoration Technology.  \r\n\r\nOur photo restoration services include:\r\nremoval of spots, stains, and mould \r\nrepair of scratches, cracks and tears  \r\nremoval of colour casts     \r\nrestoring contrast in faded photos       \r\n     \r\n\r\nOur enhancement & repair services include:\r\nremoval of blemishes and small objects \r\nairbrushing and retouching     \r\nbackground change      \r\nremoval of large objects     \r\nrecomposition (from more than one image)       \r\nany other digital photo enhancement YOU can think of     \r\n. Clipping Path/Masking\r\n. 360 degree Spin Photo Editing\r\n. Interior/exterior image editing \r\n. Clothing Images Editing\r\n. Removing dolls/mannequin from a cloth Image\r\n. Adjustment of Inserts in Cloth Images\r\n. Rectification of Stylist Errors\r\n. Color Correction\r\n. Beauty Retouching (Skin + Cloth + Background)\r\n. Retouching of Automobile images\r\n. Retouching of Jewelery Images\r\n. Food Photo Editing &Corrections\r\n \r\n\r\n \r\n\r\nSo what are you waiting for? Do something now!\r\n\r\nSend us your digital images or scanned photos NOW for a free no-obligation quote at mukeshhello7@gmail.com.\r\n\r\n \r\n\r\nIf you\'re not comfortable sending things from your computer to ours but you can send an e-mail , then you\'re still ready to do business with us.You\'ll feel GREAT when you see your old photographs restored.\r\n\r\n \r\n\r\nYou only pay to receive the final image if you are completely satisfied - so why don\'t you send us your images or photos now, you\'ve nothing to lose, and it\'s so easy.\r\n\r\nWe value your Business and Expecting your kind positive reply with some new images.\r\n\r\n \r\n\r\n \r\n\r\nKindest Regards\r\n    Mukesh \r\nVice President-Marketing Operations\r\n {E}mukeshhello7@gmail.com\r\n mukeshphoto2artinc@gmail.com\r\n{M}+91-9582461914\r\n{Skype} mukesh.hello\r\nNew Delhi | India\r\n\r\n \r\n\r\n \r\n', ''),
