(87, 'Borbala Suto-Nagy and Laszlo Salamon', 'sn.borbala@gmail.com', '', 'Dear Photoworks Direct,\r\n\r\nwe are an efficient young professional photographer and retoucher couple from Hungary.\r\nWe met more than 2 years ago and we work together. You can download our portfolio of the old photo restoration work we did: http://www.salamonlaszlo.hu/RestorationPortfolio.pdf\r\n\r\nIt would be a great opportunity to work for you online, if you like our portfolio, please contact us.\r\n\r\n\r\nRegards,\r\nBorbla St-Nagy and Lszl Salamon \r\n\r\nwww.snbora.hu\r\ninfo@snbora.hu\r\n\r\nwww.salamonlaszlo.hu\r\ninfo@salamonlaszlo.hu', ''),
