(99, 'Mustafizur', 'rsbdtext@gmail.com', '', '\r\nDear Sir,\r\n\r\n\r\nThis is Rs Graphics. We have a team of clipping path .We are giving service since 2010.We have expert designer in our team. We are giving 24/7 services. We know that you are the pioneer of clipping path sector. So we the team is most interest to work with you. For reference please have a look to my sample image. If you want you can check our quality and service. Please send me sample images.\r\n\r\nOur service:\r\n\r\n*Image Clipping Path\r\n\r\n*Image Masking\r\n\r\n*Image retouching\r\n\r\n*Alpha\r\n\r\n*Create  shadow\r\n\r\n*Color path etc\r\n\r\nWe offers free trials up to three images to evaluate our guaranteed service quality to new clients. We will process the trial files completely free of charge.\r\n\r\nGenerally it will take at least 7 hours after files received.\r\n\r\n Web site    :www.rsclippingpath.com  (its now developing)\r\n\r\nG-Mail      :rsbdtext@gmail.com\r\n\r\nHotmail   :clippingmedia@hotmail.com\r\n\r\nSkype      :rscpgraphics\r\n\r\nWe are waiting for your kind feedback.\r\n\r\nPlease see the sample below attachment. Please click below.\r\n\r\nhttps://www.dropbox.com/l/TMdJMZ7hzIYtDGcJAbBEBa\r\n\r\n', ''),
(100, 'Nikunj Gajjar', 'ngajjar30@gmail.com', '', 'Hello, \r\n\r\nRespected sir\r\n\r\nMy self Nikunj Gajjar ( NR Graphics.INDIA )\r\n\r\n      I have 9 years experiences in photo RESTORATION and EDITING.I am working whole day at home, so if you have any type of work regarding Photoshop, please contact me.  I am waiting your replay.\r\n\r\nyours faith fully\r\nNikunj Gajjar\r\n\r\nPlease contact me at\r\n\r\nCell No : +91 97237 48386\r\n\r\nMail ID : ngajjar30@gmail.com\r\n\r\nSkype ID : ngajjar20\r\n\r\nThanks\r\n', ''),
