(104, 'MD:Rasel Haider', 'image.expertbd@gmail.com', '', 'Hi, we are a new image editing company in bangladesh & My name is MD Rasel Haider Marketig Maneger in Image Expart.\r\n\r\nImage Expart is an image editing and graphic design company which provides a range of high quality of Photoshop image clipping, masking, resizing, retouching around the world. We are open 24 hrs to serve our clients. Our team is available for overnight services too. So request a quote anytime if you have any images need editing, and get a reply within ONE HOUR. And we give importance on quality rather than price. So judge our quality first. If you are happy with your work then pay. And our price is comparatively low from other company.\r\nWe focus on:\r\n1. Customer Relationship.\r\n2. Quality work.\r\n3. Client satisfaction.\r\n4. On-time Delivery (maximum 24 hrs).\r\n5. Re work till client get satisfaction.\r\n6. Offering advantage of the time zone differences.\r\n7. Convenient Payment options that client likes.\r\n8. Emergency delivery if needed.\r\n9. 24 hours service (no holidays).\r\n10. Exclusive Service Feature.\r\n\r\n\r\nOur services:\r\n\r\nClipping path\r\nClipping with natural shadow\r\nClipping with drop shadow\r\nSilo path in Photoshop\r\nVector mask\r\nRetouch images\r\nColor correction\r\nColor change\r\nMasking\r\nInvisible man/Neck fill\r\nothers\r\nyou can send some image for trail, If you choice our sample then we are agree to work with you.\r\nThanks for having (your) patience.\r\n\r\nBest\r\nMD:Rasel Haider', ''),
(105, 'Katie Evans', 'katieevansster@gmail.com', '', 'Hi,\r\n\r\nI have about 50 photos that I need editing, they are in a raw format so I would need to send you the disk. How does that work in this instance as I cannot upload?\r\n\r\nThanks,\r\n\r\nKatie Evans', ''),
(106, 'Polestar Ads N Events', 'polestarads@gmail.com', '', 'We  do photo retouching & photo editing jobs. We will be glad to extend our services to you.', ''),
(107, 'shrikant gupta', 'themaskads@gmail.com', '', 'Dear Sir/Mam\r\n\r\nThis is Maskads (clipping path solution) from India. I think I could help your business we provide high quality image/photo editing services.\r\nAm working as a freelance Photo shop Designer since last 5 yrs, I have a good knowledge about all Photoshop tools. I have a small team of five Photo shop experts, who are working hard to fulfill our clients requirements; we offer best quality, fast service in a very low price\r\n(Price starts from 0.5 $ per Image), also have a discount system for large volume of work and long term customers.\r\n \r\nWe offer these services\r\n\r\n1)	Clipping Path\r\n\r\n2)	Multiple Clipping path\r\n\r\n3)	Complex / Advanced Clipping path\r\n\r\n4)	Removing objects, backgrounds, persons etc.\r\n\r\n5)	Photo Retouching\r\n\r\n\r\nFor further details please log on to our website at www.maskads.com  \r\n\r\nWe hope our service range and facilities will be of interest to you and we look forward to your valued enquiry, to enable us to respond to your specific requirement, in order to get your valued order for rendering our professional services.   \r\n\r\n\r\nI look forward for a favorable response from you, you can avail the offer of 3 tests Pictures by sending us email.\r\n\r\n\r\n Regards,\r\n Shrikant Gupta\r\n http://maskads.com\r\n themaskads@gmail.com\r\n Skype id: maskads\r\n', ''),
(108, 'John gill', 'Maoz786@gmail.com', '', 'Hello Team,\r\n\r\nI\'m Maoz, We need your help related to photography. We want to start business with You as a partner. Please Edit three pictures for us as a trial so that we start further orders from you. Also give us a price as a partner quote. We need two features in picture editing & highly professional work required.\r\n\r\n1. Add Remove Person / Object\r\n\r\n2.Background Change\r\n\r\nPlease reply us as soon as possible. we\'ll wait for your positive reply.Then we will share pictures with complete detail of editing work.\r\n\r\nRegards,\r\nMaoz', ''),
(109, 'Peter O\'Connor', 'peteroc@talktalk.net', '', 'I have an image that I want edited and enhanced but I don\'t know whether you can achieve what I want. I also dont know what level of enhancement to select. Obviously I dont want to pay before I know what I want is possible. Do you provide quotations by email?', ''),
(110, 'Scott Fisk', 'scott@dawsonsfurniture.co.nz', '', 'Hi There\r\n\r\nI want to replace the background and fence of an image of an outdoor sofa with a cliff top ocean background. are you ale to do this? Can you source a suitable background? What is your turnaround time and of course what would be the cost?\r\n\r\nRegards\r\n\r\nScott Fisk\r\nDawsons Furniture\r\nNew Zealand', ''),
(111, 'Mintech seo solution', 'help@mintechseosolution.com', '', 'Mintech Seo Solution provides you complete solution for SEO.  We Submit your website to social bookmarking site manually @ just 10 cent per submission for more 1000 websites. For more detailsL: http://www.mintechseosolution.com\r\n', ''),
(112, 'Tracy Green', 'tracy.dore@btinternet.com', '', 'Hi\r\nI would like to use a photo for my passport photo but need the background plain behind me & photo retouched to look clearer, then I would like some printed. Is this something you can do ? I can email the photo for you to look at.\r\nThanks\r\nTracy Green', ''),
