(78, 'Carol Kellett', 'carol257@talktalk.net', 'Hello\r\n\r\nFrom the attached photo is it possible to make the colour and contrast really effective, but also to make  skin tone (especially on the boys) more even.   My daughter (in black dress)  needs to be slightly airbrushed i.e slightly slimmer (her choice),  slight side fringe (as too much forehead on show) but the main thing is to open her eyes more with colour (blue/green) and make it appear that she is not wearing so much eye make-up.  (maybe \'open\' my eyes a bit more as well please.\r\n\r\nThanking you\r\n\r\nCarol Kellett', '19122012145036CAROL & KIDS.jpg', '07830659644', '19497'),
