(81, 'Lasma', 'lasma.kokina@gmail.com', 'Hi, I\'d like to retouch this image. Maybe a little face general retouch, especially on the skin under my eyes, and perhaps there\'s a way to make the face look less \'blurry\'. Also, if there\'s something that can be done to \'smooth\' my hair, as it looks a bit messy/damaged. Not sure if there is anything that can be done to improve the image quality colour-wise, but I\'ll accept anything. \r\n\r\nPlease contact me via email if possible. ', '25012013153812_DSC0102-1 (1).jpg', '07564655388', '13350'),
(82, 'Precy', 'precyrpereira@gmail.com', 'As you can see my makeup on my wedding day went wrong.\r\n\r\nI would really like the makeup to look natural and match my skin tone.', '10022013221447DSC_0051.JPG', '07774323704', '357'),
(83, 'Norah MacPhee', 'norah.macphee@virgin.net', 'can you please sharpen and enhance this photo.  I want it made into a portrait tattoo of just her head, but have been told by the artist that the clarity isn\'t good enough, so anything you can do to improve it will be welcome.  Sadly she died suddenly so I\'m unable to get another photo of her.\r\n\r\n\r\nregards\r\n\r\nNorah', '16032013105754Noshalot original photo.jpg', '07885782647', '10016'),
