(30, 1, 'Basic level', 0, 5.99, 'The following services are included in this level.\r\nCropping\r\nRed eye removal\r\nMinor blemish removal\r\nMinor colour improvement\r\nImprove face/body\r\nRemove minor elements\r\nYou can specify your requirements in detail by clicking \\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\"add notes\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\"', '', '', '', 0, 1, 1),
(31, 1, 'Advanced Level', 0, 15.99, 'In the advanced level photo fix and enhance you can choose the following services. \r\nCropping\r\nRed eye removal\r\nMedium scratch and blemish removal\r\nMedium colour improvement\r\nImprove face/body\r\nSkin texture correction\r\nRemove / Restore  elements\r\nImage enlargement\r\nBeauty/ fashion retouching\r\nShape and size correction\r\nWhitening teeth\r\nYou can specify your requirements in detail by clicking \\\'add notes \\\'', '', '', '', 0, 1, 1),
(32, 1, 'Expert Level', 0, 24.99, '	Cropping\r\n	Red eye removal\r\n	Complex enhancement\r\n	Complex scratch/ blemish removal\r\n	Major colour improvement\r\n	Improve face/body\r\n	Skin texture correction\r\n	Complex object removal and restoration\r\n	Image enlargement and reduction\r\n	Beauty/ fashion retouching\r\n	Shape and size correction\r\nWhitening teeth\r\nMerge photos\r\nCreative effects\r\nFeature enhancement\r\nChange backgrounds\r\nCosmetic retouching\r\n', '', '', '', 0, 1, 1),
(26, 2, 'Basic Level ', 0, 5.99, 'Photos without physical damage\r\nRemove minor scratches\r\nRestore faded photos\r\nRepair photo discolouration\r\nImprove photo quality\r\n', '', '', '', 0, 1, 1),
(27, 2, 'Advanced Level', 0, 15.99, 'Photos with some physical damage\r\nRemove creases,lines,marks,stains from the background\r\nColour balancing  Correct  contrast / brightness\r\nImprove photo quality\r\nReplace any missing part\r\n', '', '', '', 0, 1, 1),
(28, 2, 'Expert Level', 0, 24.99, 'The following services are included in this level\r\nRestore photos extensively damaged\r\nRepair photos damaged by stains, water, creases or dust\r\nRemove creases, lines, marks, stains from the background\r\nRebuild parts of subject or background\r\nChange old Black& White photos to colour \r\n', '', '', '', 0, 1, 1),
(73, 7, 'One-Panel Pop', 0, 14.99, 'Like to change your pic to look like this sample and hang it on your wall? Upload your picture. We will do the rest', '', '2161730onepanelpopart.jpg', '', 0, 1, 1),
