(2, 'Forgot Password', '<table style=\"border: 0px none currentcolor; width: 100%; color: #666666; font-family: Verdana,Arial,Helvetica,sans-serif; font-size: 12px;\" border=\"0\" cellspacing=\"5\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"3\" align=\"left\" valign=\"top\"><img src=\"http://photoworksdirect.com/images/logo.jpg\" alt=\"\" /></td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #ff0000; font-size: 14px; font-weight: bold;\" colspan=\"3\" align=\"left\">Hi |@|name|@|!</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font-weight: bold;\" colspan=\"3\" align=\"left\">This email is a response to your new password request.</td>\r\n</tr>\r\n<tr>\r\n<td height=\"20\"></td>\r\n</tr>\r\n<tr>\r\n<td>Email Address:|@|email|@|</td>\r\n</tr>\r\n<tr>\r\n<td></td>\r\n</tr>\r\n<tr>\r\n<td>Your new password:|@|password|@|</td>\r\n</tr>\r\n<tr>\r\n<td><br /><strong>Note:</strong> After logging in, you can manually change your password to your preferred choice using the \'Change Password\' option.</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font-size: 11px;\" colspan=\"3\" align=\"left\"><br />\r\n<p>Regards</p>\r\n<p></p>\r\n<p>Photoworks direct</p>\r\n<p></p>\r\n\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>'),
(4, 'Contact Us', '<table style=\"width: 100%; font-family: Verdana,Arial,Helvetica,sans-serif; color: #666666; font-size: 12px; border-width: 0px;\" border=\"0\" cellspacing=\"5\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"3\" align=\"left\" valign=\"top\"><img src=\"http://photoworksdirect.com/images/logo.jpg\" alt=\"\" /></td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #ff0000; font-size: 14px; font-weight: bold;\" colspan=\"3\" align=\"left\">Hi,</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font-weight: bold;\" colspan=\"3\" align=\"left\">You have a feedback from this mail id <span style=\"color: #ff0000; font-size: 14px; font-weight: bold;\">|@|contact_email|@|!.</span></td>\r\n</tr>\r\n<tr>\r\n<td style=\"font-weight: bold;\" colspan=\"3\" align=\"left\">Contact Name &nbsp;:&nbsp;|@|contact_name|@|</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font-weight: bold;\" colspan=\"3\" align=\"left\">Email id &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;: |@|contact_email|@|</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font-weight: bold;\" colspan=\"3\" align=\"left\">Enquiry &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;: |@|contact_enquiry|@|</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font-weight: bold;\" colspan=\"3\" align=\"left\">Date &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : |@|contact_date|@|</td>\r\n</tr>\r\n<!--<tr>\r\n    <td>Your friend has suggested you join <a href=\"|@|site_link|@|\">|@|site_link|@|</a>. </td>\r\n  </tr>-->\r\n<tr>\r\n<td style=\"font-size: 11px;\" colspan=\"3\" align=\"left\"><br />\r\n<p><strong>Thank You</strong></p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>'),
(5, 'Offer Email', '<p>&nbsp;</p>\r\n<div style=\"width: 100%; height: auto; font-family: Arial, Helvetica, sans-serif;\">\r\n<div style=\"width: 950px; height: auto; margin-top: 15px; float: left;\">\r\n<div style=\"width: 950px; height: auto;\">\r\n<div style=\"width: 950px; height: 45px;\"><img src=\"http://myphotopicture.co.uk/images/logo.jpg\" alt=\"\" /><!--Logo End--></div>\r\n<!--Logo Main End-->\r\n<div style=\"padding: 5px 0px; width: 950px; height: auto; float: left;\">\r\n<h3 style=\"color: #01bef5; padding-left: 18px; font-size: 16px; font-weight: bold;\">Let us reveal the real you</h3>\r\n<h2 style=\"color: #ff0911; padding-left: 18px; font-size: 14px; font-weight: bold;\">|@|subject|@|</h2>\r\n<p>|@|username|@|</p>\r\n</div>\r\n<div style=\"width: 950px; height: auto; float: left;\">\r\n<table style=\"width: 950px;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td width=\"35%\">&nbsp;</td>\r\n<td width=\"9%\"><a style=\"padding: 0px 15px; text-align: right; color: #666666; line-height: 36px; font-size: 13px; font-weight: bold; text-decoration: none;\" href=\"http://myphotopicture.co.uk/index.php\">HOME</a></td>\r\n<td width=\"11%\"><a style=\"padding: 0px 15px; text-align: right; color: #666666; line-height: 36px; font-size: 13px; font-weight: bold; text-decoration: none;\" href=\"http://myphotopicture.co.uk/aboutus.php\">ABOUT US</a></td>\r\n<td width=\"17%\"><a style=\"padding: 0px 15px; text-align: right; color: #666666; line-height: 36px; font-size: 13px; font-weight: bold; text-decoration: none;\" href=\"http://myphotopicture.co.uk/prices.php\">PRICES &amp; SERVICES</a></td>\r\n<td width=\"13%\"><a style=\"padding: 0px 15px; text-align: right; color: #666666; line-height: 36px; font-size: 13px; font-weight: bold; text-decoration: none;\" href=\"http://myphotopicture.co.uk/contactus.php\">CONTACT US</a></td>\r\n<td width=\"7%\"><a style=\"padding: 0px 15px; text-align: right; color: #666666; line-height: 36px; font-size: 13px; font-weight: bold; text-decoration: none;\" href=\"http://myphotopicture.co.uk/faq.php\">FAQ</a></td>\r\n<td width=\"8%\"><a style=\"padding: 0px 15px; text-align: right; color: #666666; line-height: 36px; font-size: 13px; font-weight: bold; text-decoration: none;\" href=\"http://myphotopicture.co.uk/login.php\">LOGIN</a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<!--Button End--><!--Clear End--></div>\r\n<!--Button Main End-->\r\n<div style=\"width: 950px; height: 17px; float: left; background-color: #f2f2f2;\">&nbsp;</div>\r\n<!--Ash Box End--></div>\r\n<!--Header End-->\r\n<div style=\"width: 940px; height: auto; margin-bottom: 35px;\">\r\n<div style=\"width: 370px; height: auto; float: left;\">\r\n<div style=\"width: 370px; height: auto; float: left;\">\r\n<div style=\"font: 12px/normal Arial, Helvetica, sans-serif; width: 90px; height: auto; padding-top: 80px; padding-bottom: 50px; float: left; font-size-adjust: none; font-stretch: normal;\">Original Image:</div>\r\n<!--Photo Content End-->\r\n<div style=\"padding: 15px 0px 0px 20px; width: 250px; height: auto; float: left;\"><img src=\"|@|original|@|\" alt=\"\" /></div>\r\n</div>\r\n<!--Photo End-->\r\n<div style=\"width: 370px; height: auto; float: left;\">\r\n<div style=\"font: 12px/normal Arial, Helvetica, sans-serif; width: 90px; height: auto; padding-top: 80px; float: left; font-size-adjust: none; font-stretch: normal;\">Edited Image:</div>\r\n<!--Photo Content End-->\r\n<div style=\"padding: 15px 0px 0px 20px; width: 250px; height: auto; float: left;\"><a href=\"|@|url|@|\"><img src=\"|@|edited|@|\" alt=\"\" /></a></div>\r\n</div>\r\n</div>\r\n<!--Photo End--><!--Left Content End-->\r\n<div style=\"width: 550px; height: auto; float: right;\">\r\n<h1 style=\"color: #656565; line-height: normal; font-size: 20px; font-weight: bold; margin-bottom: 0px;\">World\'s leading creative <br />photo re-touching</h1>\r\n<h4 style=\"color: #ffffff; font-size: 13px; font-weight: bold; margin-top: 9px;\"><span style=\"padding: 0px 5px; color: #ffffff; background-color: #666666;\">Ever wondered why your face you&rsquo;re so accustomed to looking at in the mirror</span><br /><span style=\"padding: 0px 5px; color: #ffffff; background-color: #666666;\">is not always the one captured in a photo? </span></h4>\r\n<p style=\"color: #656565; font-size: 12px; margin-top: 9px;\">With our proprietary and patented software operated by the industry\'s experts, we will ensure to process and capture your <strong>True Essence</strong>! We also provide a range of other services such as \"quick make up\"; \"makeover\"; illustrations, and much more</p>\r\n<p style=\"color: #656565; font-size: 12px; margin-top: 9px;\">Please visit us at&nbsp;<a title=\"www.myphotopicture.co.uk\" href=\"http://myphotopicture.co.uk/index.php\">www.myphotopicture.co.uk</a> to see our <strong>Terms&nbsp;of Service</strong>, and&nbsp;what we can do for you!</p>\r\n<h5 style=\"color: #656565; font-size: 14px; font-weight: bold; margin-top: 9px; margin-bottom: 0px;\">You can also <span style=\"color: #b4d127;\"><a href=\"|@|url|@|\">buy &amp; download your edited photo </a></span>, through our secure <span style=\"color: #b4d127;\"><a href=\"|@|url|@|\">SSL certified payment system</a></span>, for as little as |@|tot_price|@|</h5>\r\n<p style=\"color: #656565; font-size: 12px; margin-top: 9px;\">After the payment, you will be granted access to your personal project page, by using an invoice number that will be automatically emailed to you, so you can login and download your final edited image.</p>\r\n<p style=\"color: #656565; font-size: 12px; margin-top: 9px;\">Please note that, the final edited image will be the original size&nbsp;as displayed on your public web profile.&nbsp;Alternatively, you may go to our main webpage to submit a new image of a higher resolution, if desired.</p>\r\n<p style=\"color: #656565; font-size: 12px; margin-top: 9px;\">The photos displayed here or submitted to Myphotopicture&rsquo;s server and derivative of retouched/edited images are NOT accessible to public unless you have given explicit consent for us to share them.&nbsp;</p>\r\n<h5 style=\"color: #656565; font-size: 14px; font-weight: bold; margin-top: 9px; margin-bottom: 0px;\"><span style=\"color: #b4d127;\">Why wait? We invite you to sit back, relax and let us reveal the real you!</span></h5>\r\n</div>\r\n<!--Right Content End--><!--Clear End--></div>\r\n<!--Content Main Box End--><!--Ash Box End-->\r\n<div style=\"width: 950px; height: 27px; float: left;\">&nbsp;</div>\r\n<div style=\"width: 950px; height: 17px; float: left; background-color: #f2f2f2;\">&nbsp;</div>\r\n<div style=\"width: 954px; height: 98px; float: left;\">\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #808080;\"><strong>Security disclaimer:</strong> <span style=\"font-size: xx-small;\">Myphotopicture will never ask customers to supply personal details such as date of birth, address, occupation or nationality. If anyone or any company contacts you for such information we would advise you to treat such e-Mails as a<strong> phishing scam</strong>. You are therefore asked to<strong> </strong>report it to us immediately at </span></span><span style=\"font-size: xx-small;\"><a href=\"mailto:info@myphotopicture.co.uk\">info@myphotopicture.co.uk</a> .<span style=\"color: #808080;\">Myphotopicture does not have access to customers\' credit card details and other personal information supplied during payment transactions. All payments are handled externally by secure and trusted world-famous payment gateways such as <strong>2CO</strong>,etc.</span></span></p>\r\n<p style=\"color: #656565; font-size: 12px; margin-top: 9px;\"><span style=\"color: #808080;\"><span style=\"font-size: xx-small;\">When in our website to order a service, or login, but unsure of the website&rsquo;s legitimacy, we strongly advise our visitors and customers to </span><span style=\"font-size: xx-small;\">thoroughly check the website to find any suspicious signs of a scam. Often </span><span style=\"font-size: xx-small;\">these suspicious signs are easily detected on pages such as &ldquo;About Us&rdquo;; &ldquo;Prices </span><span style=\"font-size: xx-small;\">&amp; Services&rdquo;; &ldquo;Home&rdquo;; &ldquo;FAQ&rdquo;; &ldquo;GeoTrust&rdquo; sign; &ldquo;Visa&rdquo; sign, <strong>and other main web page links</strong>.</span></span></p>\r\n<p style=\"color: #656565; font-size: 12px; margin-top: 9px;\"><span style=\"font-size: xx-small;\">The content of e-Mails sent, and any electronic files attached to e-Mails,</span><span style=\"font-size: xx-small;\">are confidential. If any correspondence had been incorrectly addressed </span><span style=\"font-size: xx-small;\">(whatever the reason), you are hereby notified NOT to copy or forward it. You </span><span style=\"font-size: xx-small;\">should also refrain from altering it. </span><span style=\"font-size: xx-small;\">However, you may delete it and contact <a href=\"mailto:info@myphotopicture.co.uk\">info@myphotopicture.co.uk</a> .Myphotopicture is a Private limited </span><span style=\"font-size: xx-small;\">company, Registered in England and Wales with Companies House<strong>. Company Number: 7731742</strong></span></p>\r\n<p style=\"color: #656565; font-size: 12px; margin-top: 9px;\">&nbsp;</p>\r\n<p style=\"color: #656565; font-size: 12px; margin-top: 9px;\">&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div style=\"width: 950px; height: auto;\">\r\n<p style=\"color: #656565; font-size: 12px; margin-top: 9px;\"><br />&nbsp;</p>\r\n</div>\r\n<!--Fooer End--></div>\r\n<!--Main Box End--></div>\r\n<!--Main Container End-->'),
(6, 'Project Closed Email', '<table style=\"border: 0px none currentcolor; width: 100%; color: #666666; font-family: Verdana,Arial,Helvetica,sans-serif; font-size: 12px;\" border=\"0\" cellspacing=\"5\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"3\" align=\"left\" valign=\"top\"><img src=\"http://myphotopicture.co.uk/images/logo.jpg\" alt=\"\" /></td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #ff0000; font-size: 14px; font-weight: bold;\" colspan=\"3\" align=\"left\">Hi, |@|notify_person|@|</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font-weight: bold;\" colspan=\"3\" align=\"left\">Your Project was closed , because there&nbsp;was no response from you in the past&nbsp;30 days!</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font-weight: bold;\" colspan=\"3\" align=\"left\">Project id&nbsp;: |@|project_id|@|</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font-size: 11px;\" colspan=\"3\" align=\"left\"><br />\r\n<p><strong>Thank You</strong></p>\r\n<p><strong></strong><br />This is an&nbsp;automated email</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font-size: 9px;\" colspan=\"3\" align=\"left\" height=\"27\">\r\n<p><span style=\"font-size: xx-small;\"><strong>Security disclaimer:</strong> Myphotopicture will never ask customers to supply personal details such as date of birth, address, occupation or nationality. If anyone or any company contacts you for such information we would advise you to treat such e-Mail as a<strong> phishing scam</strong>. You are therefore asked to<strong> </strong>report it to us immediately at <a href=\"mailto:info@myphotopicture.co.uk\">info@myphotopicture.co.uk</a> <span style=\"color: #000000;\">.Di</span>gipicture does not have access to customers\' credit card details and other personal information supplied during payment transactions. All payments are handled externally by secure and trusted world-famous payment gateways such as 2CO,</span><span style=\"font-size: xx-small;\">etc.</span></p>\r\n<p><span style=\"font-size: xx-small;\">Wh