(7, 'Project Closing Email', '<table style=\"border: 0px none currentcolor; width: 100%; color: #666666; font-family: Verdana,Arial,Helvetica,sans-serif; font-size: 12px;\" border=\"0\" cellspacing=\"5\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"3\" align=\"left\" valign=\"top\"><img src=\"http://myphotopicture.co.uk/images/logo.jpg\" alt=\"\" /></td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #ff0000; font-size: 14px; font-weight: bold;\" colspan=\"3\" align=\"left\">Hi, |@|notify_person|@|</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font-weight: bold;\" colspan=\"3\" align=\"left\">Your Project&nbsp;<strong> will be automatically closed within the next 5 days</strong> , because there&nbsp;was no response from you in the&nbsp;past 25 days.</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font-weight: bold;\" colspan=\"3\" align=\"left\">Project id&nbsp;: |@|project_id|@|</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font-size: 11px;\" colspan=\"3\" align=\"left\"><br />\r\n<p><strong>Thank You</strong></p>\r\n<p><strong></strong><br />This is an automated email</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font-size: 9px;\" colspan=\"3\" align=\"left\" height=\"27\">\r\n<p><span style=\"font-size: xx-small;\"><strong>Security disclaimer:</strong> Myphotopicture will never ask customers to supply personal details such as date of birth, address, occupation or nationality. If anyone or any company contacts you for such information we would advise you to treat such e-Mail as a<strong> phishing scam</strong>. You are therefore asked to<strong> </strong>report it to us immediately at <a href=\"mailto:info@myphotopictures.co.uk\">info@myphotopicture.co.uk</a> .Myphotopicture does not have access to customers\' credit card details and other personal information supplied during payment transactions. All payments are handled externally by secure and trusted world-famous payment gateways such as 2CO,</span><span style=\"font-size: xx-small;\">etc.</span></p>\r\n<p><span style=\"