(8, 'Invoice', '<p>&nbsp;</p>\r\n<table style=\"border: 0px none currentcolor; width: 100%; color: #666666; font-family: Verdana,Arial,Helvetica,sans-serif; font-size: 12px;\" border=\"0\" cellspacing=\"3\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td align=\"left\" valign=\"top\"><img src=\"http://myphotopicture.co.uk/images/logo.jpg\" alt=\"\" /></td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #009999; font-size: 14px; font-weight: bold;\" align=\"left\">Hi |@|notify_person|@|,</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font-weight: bold;\" align=\"left\">Please see below your Invoice&nbsp;details:</td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #009999; font-size: 12px; font-weight: bold;\" align=\"left\"><br />Invoice Details:</td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #009999; font-size: 12px; font-weight: bold;\" align=\"left\" height=\"29\"><span style=\"color: #666666; font-size: 12px;\">|@|invoice_content|@|</span></td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #009999; font-size: 12px; font-weight: bold;\" align=\"left\" height=\"29\">Payment Details</td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #666666; font-size: 12px;\" align=\"left\" height=\"29\">Calculated Price: &pound;|@|calc_price|@|</td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #666666; font-size: 12px;\" align=\"left\" height=\"26\">Total Amount: &pound;|@|tot_price|@|</td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #666666; font-size: 12px;\" align=\"left\" height=\"27\">Project ID: |@|project_id|@|</td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #666666; font-size: 12px;\" align=\"left\" height=\"29\">Invoice Number: |@|invoice_id|@|</td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #666666; font-size: 12px;\" align=\"left\" height=\"29\">Invoice Date: |@|invoice_date|@|</td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #666666; font-size: 12px;\" align=\"left\" height=\"29\">\r\n<p>&nbsp;Please <a href=\"|@|url1|@|\">VIEW</a> our Terms and Conditions</p>\r\n<p>Please Click <a href=\"|@|url|@|\">Here </a>to make online payment. After the payment you can full access to your personal project page using this invoice number. You can also check the&nbsp;project updates and download your final edited image.</p>\r\n<p>&nbsp;</p>\r\n<p>Regards</p>\r\n<p>&nbsp;</p>\r\n<p>Myphotopicture</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: xx-small;\"><strong>Security disclaimer:</strong> Myphotopicture will never ask customers to supply personal details such as date of birth, address, occupation or nationality. If anyone or any company contacts you for such information we would advise you to treat such e-Mail as a<strong> phishing scam</strong>. You are therefore asked to<strong> </strong>report it to us immediately at <a href=\"mailto:info@myphotopicture.co.uk\">info@myphotopicture.co.uk</a> <span style=\"color: #808080;\">.Myphotopicture</span> does not have access to customers\' credit card details and other personal information supplied during payment transactions. All payments are handled externally by secure and trusted world-famous payment gateways such as 2CO,</span><span style=\"font-size: xx-small;\">etc.</span></p>\r\n<p><span style=\"font-size: xx-small;\">When in our website to order a service, or login, but unsure of the website&rsquo;s legitimacy, we strongly advise our visitors and customers to thoroughly check the website to find any suspicious signs of a scam. Often these suspicious signs are easily detected on pages such as &ldquo;About Us&rdquo;; &ldquo;Prices &amp; Services&rdquo;; &ldquo;Home&rdquo;; &ldquo;FAQ&rdquo;; &ldquo;GeoTrust&rdquo; sign; &ldquo;Visa&rdquo; sign, <strong>and other main web page links</strong>.</span></p>\r\n<p><span style=\"font-size: xx-small;\">The contents of this email, and any electronic files attached to this e-Mail, are confidential. If this correspondence has been incorrectly addressed (whatever the reason), you are hereby notified NOT to copy or forward it. You should also refrain from altering it. However, you may delete it and contact <a href=\"mailto:info@myphotopicture.co.uk\">info@myphotopicture.co.uk</a> <span style=\"color: #808080;\">.Myphotopicture</span> is a Private limited </span><span style=\"font-size: xx-small;\">company, Registered in England and Wales with Companies House<strong>. Company Number: 7731742</strong></span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>'),
(9, 'Project Completed', '<table style=\"border: 0px none currentcolor; width: 100%; color: #666666; font-family: Verdana,Arial,Helvetica,sans-serif; font-size: 12px;\" border=\"0\" cellspacing=\"3\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td align=\"left\" valign=\"top\"><img src=\"|@|image_header|@|\" alt=\"\" /></td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #009999; font-weight: bold; font-size: 14px;\" align=\"left\">\r\n<p>Hi |@|notify_person|@|,</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #666666; font-size: 12px;\" align=\"left\" height=\"29\">\r\n<p>Your Project (Project ID |@|project_id|@|) has been successfully completed . Please Click <a href=\"|@|url|@|\">Here </a>to login, and download your edited photo.</p>\r\n<p>Regards<br />Team and Management<br />Photoworksdirect</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"border: 0px none currentcolor; width: 100%; color: #666666; font-family: Verdana,Arial,Helvetica,sans-serif; font-size: 12px;\" border=\"0\" cellspacing=\"3\" cellpadding=\"10\">\r\n<tbody>\r\n<tr>\r\n<td style=\"font-size: 11px;\" colspan=\"4\" align=\"left\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font-size: 9px;\" colspan=\"3\" align=\"left\" height=\"27\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>'),
(10, 'Payment Confirmation - Admin', '<div style=\"width: 800px;\">\r\n<table style=\"border: 0px none currentcolor; width: 100%; color: #666666; font-family: Verdana,Arial,Helvetica,sans-serif; font-size: 12px;\" border=\"0\" cellspacing=\"3\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td align=\"left\" valign=\"top\"><img src=\"|@|image_header|@|\" alt=\"\" /></td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #009999; font-size: 14px; font-weight: bold;\" align=\"left\">Hi |@|notify_person|@|,</td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #666666; font-size: 14px;\" align=\"left\" height=\"29\">\r\n<p>&nbsp;</p>\r\n<p>A new order&nbsp;had been&nbsp;submitted from |@|name|@|.The order details below. &nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #666666; font-size: 12px; font-weight: bold;\" align=\"left\"><br /> Email Id : |@|email|@|</td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #666666; font-size: 12px; font-weight: bold;\" align=\"left\"><br /> Project_id : |@|project_id|@|</td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #666666; font-size: 12px;\" align=\"left\" height=\"26\"><strong>Amount: |@|price|@| </strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #666666; font-size: 12px;\" align=\"left\" height=\"26\"><strong><br /></strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #666666; font-size: 12px;\" align=\"left\" height=\"26\"><strong><br /></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"border: 0px none currentcolor; width: 100%; color: #666666; font-family: Verdana,Arial,Helvetica,sans-serif; font-size: 12px;\" border=\"0\" cellspacing=\"3\" cellpadding=\"10\">\r\n<tbody>\r\n<tr>\r\n<td style=\"font-size: 11px;\" colspan=\"4\" align=\"left\">\r\n<p><span style=\"color: #808080;\">Regards</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #808080;\">Photowork direct</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font-size: 9px;\" colspan=\"3\" align=\"left\" height=\"27\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>')