(11, 'Payment Confirmation - User (Edited Photo Uploaded)', '<div style=\"width: 800px;\">\r\n<table style=\"border: 0px none currentcolor; width: 100%; color: #666666; font-family: Verdana,Arial,Helvetica,sans-serif; font-size: 12px;\" border=\"0\" cellspacing=\"3\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td align=\"left\" valign=\"top\"><img src=\"|@|image_header|@|\" alt=\"\" /></td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #009999; font-size: 14px; font-weight: bold;\" align=\"left\">Hi |@|notify_person|@|,</td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #666666; font-size: 14px;\" align=\"left\" height=\"29\">\r\n<p>&nbsp;</p>\r\n<p>Thank you. Please refer to your order details below.You can access your personal project page using this invoice number, and&nbsp; download your final edited image .&nbsp; Please click <a href=\"|@|url|@|\">here</a> to access your project page.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #666666; font-size: 12px; font-weight: bold;\" align=\"left\"><br /> Project_id : |@|project_id|@|</td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #009999; font-size: 12px; font-weight: bold;\" align=\"left\" height=\"29\"><span style=\"color: #666666; font-size: 12px;\">Invoice Number : |@|inv_num|@|</span></td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #666666; font-size: 12px;\" align=\"left\" height=\"26\"><strong>Amount: |@|price|@| </strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #666666; font-size: 12px;\" align=\"left\" height=\"26\"><strong><br /></strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #666666; font-size: 12px;\" align=\"left\" height=\"26\"><strong><br /></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"border: 0px none currentcolor; width: 100%; color: #666666; font-family: Verdana,Arial,Helvetica,sans-serif; font-size: 12px;\" border=\"0\" cellspacing=\"3\" cellpadding=\"10\">\r\n<tbody>\r\n<tr>\r\n<td style=\"font-size: 11px;\" colspan=\"4\" align=\"left\">\r\n<p><span style=\"color: #808080;\">Regards</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #808080;\">Photowork Direct<br /></span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font-size: 9px;\" colspan=\"3\" align=\"left\" height=\"27\"><br />&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>'),
(12, 'Payment Confirmation - User (Edited Photo not Uploaded)', '<div style=\"width: 800px;\">\r\n<table style=\"border: 0px none currentcolor; width: 100%; color: #666666; font-family: Verdana,Arial,Helvetica,sans-serif; font-size: 12px;\" border=\"0\" cellspacing=\"3\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td align=\"left\" valign=\"top\"><img src=\"|@|image_header|@|\" alt=\"\" /></td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #009999; font-size: 14px; font-weight: bold;\" align=\"left\">Hi |@|notify_person|@|,</td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #666666; font-size: 14px;\" align=\"left\" height=\"29\">\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: small;\">Thank you for your order. One of our graphic artist will check your pictures and requirements. We will send you the finished work to your e-mail. If we need any further details, we will contact you. In the meantime if you need to contact us, please email us to</span> <span style=\"text-decoration: underline; font-size: small;\">info@photoworksdirect.com</span></p>\r\n<p><span style=\"font-size: small;\">You can view your account details on&nbsp; My Account. Click <a href=\"|@|url|@|\">here</a> to login</span></p>\r\n<p><span style=\"font-size: small;\">Regards</span><br /><span style=\"font-size: small;\">Team and Management</span><br /><span style=\"font-size: small;\">Photoworksdirect</span><br /><br /></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"border: 0px none currentcolor; width: 100%; color: #666666; font-family: Verdana,Arial,Helvetica,sans-serif; font-size: 12px;\" border=\"0\" cellspacing=\"3\" cellpadding=\"10\">\r\n<tbody>\r\n<tr>\r\n<td style=\"font-size: 11px;\" colspan=\"4\" align=\"left\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"font-size: 9px;\" colspan=\"3\" align=\"left\" height=\"27\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>');
