(10270, '_transient_dash_4077549d03da2e451c8b5f002294ff51', '<div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://wordpress.org/news/2015/09/wordpress-4-3-1/\' title=\'WordPress 4.3.1 is now available. This is asecurity releasefor all previous versions and we strongly encourage you to update your sites immediately. This release addresses three issues, including twocross-site scripting vulnerabilities and a potential privilege escalation. WordPress versions 4.3 and earlier are vulnerable to a cross-site scripting vulnerability when processing shortcode tags (CVE-2015-5714). Reported by []\'>WordPress 4.3.1 Security and Maintenance Release</a> <span class=\"rss-date\">September 15, 2015</span><div class=\'rssSummary\'>WordPress 4.3.1 is now available. This is asecurity releasefor all previous versions and we strongly encourage you to update your sites immediately. This release addresses three issues, including twocross-site scripting vulnerabilities and a potential privilege escalation. WordPress versions 4.3 and earlier are vulnerable to a cross-site scripting vulnera [&hellip;]</div></li></ul></div><div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'http://wptavern.com/akismet-3-1-5-fixes-critical-xss-security-vulnerability\' title=\'If you use Akismet to battle comment spam, make sure its running version 3.1.5 as it patches a critical security vulnerability. Due to the nature of the bug, the Akismet team pushed out auto updates to sites that can accept them. According to Sucuri, sites using Akismet 3.1.4 and lower and that have the Convert emoticons like  and  to graphics on display option enabled, are at risk. The vulnerability stems from the way Akismet handles hyperlinks within a sites comments. An attacker with sufficient knowledge of WordPress internals could insert malicious scripts in the Comment section of the WordPress backend. This type of attack could lead to a number of other attacks, including compromising an entire site. So far, Akismet developers dont have any evidence that the vulnerability is actively being exploited in the wild. Because the vulnerability is theoretically exploitable via comments, Akismet is blocking attempts during the comment-check API call so that sites not running the most recent version are protected. However, you should still upgrade immediately to 3.1.5.\'>WPTavern: Akismet 3.1.5 Fixes Critical XSS Security Vulnerability</a></li><li><a class=\'rsswidget\' href=\'http://ma.tt/2015/10/working-exercising/\' title=\' One benefit of working from home that doesnt get discussed much is the ease of small, but frequent exercise activities through the day. Im sure its not outlawed in an office to get out of your chair and do 20 jumping jacks, or plank for a minute, I definitely would feel awkward doing so. This is something on my mind as Im working this week around ~400 colleagues for our once-a-year Grand Meetup. When Im home and have a ton of work to get through, my favorite approach is the Pomodoro Technique with 25 minutes on followed by a 5 minute break. (I use this app but any timer will do.) The 5 minute break is a fantastic time to do something small, like a few push-ups, squats, a plank, or even meditate. (The new Pause app is cool, and of course I love Calm.) You dont have to do a ton, but over the course of a day or a week these 5 minute break exercises add up to be quite a bit and can kickstart a Tiny Habit. And dont even get me started on the benefits of naps. Again, not something thats impossible in an shared office, just feels a lot more natural and less embarrassing in your private home office.\'>Matt: Working &amp; Exercising</a></li><li><a class=\'rsswidget\' href=\'http://blog.akismet.com/2015/10/13/akismet-3-1-5-wordpress/\' title=\'Version 3.1.5 of the Akismet plugin for WordPress contains a critical security fix. Update your sites as soon as possible. A researcher from Sucuri notified us of an XSS vulnerability in the Akismet WordPress plugin. This bug affects all versions of the Akismet WordPress plugin since 2.5.0, but we have no evidence that it has been exploited in the wild. Weve released updates for all vulnerable versions of the Akismet plugin. Additionally, the WordPress.org plugins team has enabled an automatic update for all sites running these vulnerable versions that are able to auto-update plugins. Because the vulnerability is theoretically exploitable via comments, Akismet is already blocking attempts during the comment-check API call even if you are not running the most recent version. However, to be as safe as possible, you should still upgrade immediately. To upgrade, visit the Updates page of your WordPress dashboard and follow the instructions. If you need to download the plugin zip file directly, links to all versions are available in the WordPress plugins directory.   \'>Akismet: Akismet 3.1.5: Security Release</a></li></ul></div><div class=\"rss-widget\"><ul><li class=\'dashboard-news-plugin\'><span>Popular Plugin:</span> <a href=\'https://wordpress.org/plugins/updraftplus/\' class=\'dashboard-news-plugin-link\'>UpdraftPlus Backup and Restoration</a></h5>&nbsp;<span>(<a href=\'plugin-install.php?tab=plugin-information&amp;plugin=updraftplus&amp;_wpnonce=81fec849d1&amp;TB_iframe=true&amp;width=600&amp;height=800\' class=\'thickbox\' title=\'UpdraftPlus Backup and Restoration\'>Install</a>)</span></li></ul></div>', 'no'),
