(39, 1, '2014-09-17 07:12:34', '2014-09-17 07:12:34', 'Our photo restoration service photo works direct is something we do quite proud of. Over the years we have built up a loyal customer base and from the feedback we regularly receive it is clear that the results we provide life-changing for many. Photo restoration and continues to be our main source of business to the initial thought is to focus on something striking with works such as photo restoration, photo restoration or repair of the picture.<a href=\"http://photoworksdirect.com/blog/wp-content/uploads/2014/09/rg.jpg\"><img class=\"aligncenter size-large wp-image-37\" alt=\"rg\" src=\"http://photoworksdirect.com/blog/wp-content/uploads/2014/09/rg-1024x629.jpg\" width=\"1024\" height=\"629\" /></a>\r\n\r\nPhotoworks Direct UK provides qualified professional artists and skilled people dedicated to transform your old, broken image in its original state with clarity. When you select a picture of Services Companies editing to restore your old photos, you\'ll need to choose a company that offers a wide range of services such as Photo Retouching and photo restoration services. Are your pictures requiring retouching and restoration? Photo restoration can be described as the practice of restoration of an image which is damaged or affected by age.\r\n\r\nOur<strong> <a title=\"Photo Works Direct\" href=\"http://www.photoworksdirect.com/services/photo-restoration.html\" target=\"_blank\">Photo Restoration UK</a></strong> Services provide you with a wide range of services that can restore your old and damaged photos and Reconstruct it according to your wish. Also by choosing our Best Digital Photo Restoration and Photo Restoration Services all unwanted color cast is deleted and the contrast of the image is changed to complete the restoration of images photoworks direct to get the best professional and Services Photo Restoration competent.\r\n\r\nOur technical experts working on your image restoration is well qualified in black and white to color, color to black and white hands, digital coloring, color adjustments, balancing, Tri-tone and four colors are used to bring the best picture of the digital restoration.Repair and restore old photos and bring your memories back to life. Restore photos quickly and easily atphotoworks direct. Enjoy picture restoration today and pick up in-store!\r\n\r\n&nbsp;\r\n<div>\r\n\r\n&nbsp;\r\n\r\n</div>\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n<!--[if gte mso 9]><xml>\r\n<w:WordDocument>\r\n<w:View>Normal</w:View>\r\n<w:Zoom>0</w:Zoom>\r\n<w:TrackMoves/>\r\n<w:TrackFormatting/>\r\n<w:PunctuationKerning/>\r\n<w:ValidateAgainstSchemas/>\r\n<w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n<w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n<w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n<w:DoNotPromoteQF/>\r\n<w:LidThemeOther>EN-US</w:LidThemeOther>\r\n<w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n<w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n<w:Compatibility>\r\n<w:BreakWrappedTables/>\r\n<w:SnapToGridInCell/>\r\n<w:WrapTextWithPunct/>\r\n<w:UseAsianBreakRules/>\r\n<w:DontGrowAutofit/>\r\n<w:SplitPgBreakAndParaMark/>\r\n<w:DontVertAlignCellWithSp/>\r\n<w:DontBreakConstrainedForcedTables/>\r\n<w:DontVertAlignInTxbx/>\r\n<w:Word11KerningPairs/>\r\n<w:CachedColBalance/>\r\n</w:Compatibility>\r\n<m:mathPr>\r\n<m:mathFont m:val=\"Cambria Math\"/>\r\n<m:brkBin m:val=\"before\"/>\r\n<m:brkBinSub m:val=\"--\"/>\r\n<m:smallFrac m:val=\"off\"/>\r\n<m:dispDef/>\r\n<m:lMargin m:val=\"0\"/>\r\n<m:rMargin m:val=\"0\"/>\r\n<m:defJc m:val=\"centerGroup\"/>\r\n<m:wrapIndent m:val=\"1440\"/>\r\n<m:intLim m:val=\"subSup\"/>\r\n<m:naryLim m:val=\"undOvr\"/>\r\n</m:mathPr></w:WordDocument>\r\n</xml><![endif]-->\r\n<p class=\"MsoSubtitle\"><span style=\"color: #7030a0;\