(42, 1, '2014-09-17 07:23:36', '2014-09-17 07:23:36', 'Our photo restoration service photo works direct is something we do quite proud of. Over the years we have built up a loyal customer base and from the feedback we regularly receive it is clear that the results we provide life-changing for many. Photo restoration and continues to be our main source of business to the initial thought is to focus on something striking with works such as photo restoration, photo restoration or repair of the picture.<a href=\"http://photoworksdirect.com/blog/wp-content/uploads/2014/09/rg1.jpg\"><img class=\"aligncenter size-full wp-image-41\" alt=\"rg\" src=\"http://photoworksdirect.com/blog/wp-content/uploads/2014/09/rg1.jpg\" width=\"590\" height=\"425\" /></a>\r\n\r\nPhotoworks Direct UK provides qualified professional artists and skilled people dedicated to transform your old, broken image in its original state with clarity. When you select a picture of Services Companies editing to restore your old photos, you\'ll need to choose a company that offers a wide range of services such as Photo Retouching and photo restoration services. Are your pictures requiring retouching and restoration? Photo restoration can be described as the practice of restoration of an image which is damaged or affected by age.\r\n\r\nOur<strong> <a title=\"Photo Works Direct\" href=\"http://www.photoworksdirect.com/services/photo-restoration.html\" target=\"_blank\">Photo Restoration UK</a></strong> Services provide you with a wide range of services that can restore your old and damaged photos and Reconstruct it according to your wish. Also by choosing our Best Digital Photo Restoration and Photo Restoration Services all unwanted color cast is deleted and the contrast of the image is changed to complete the restoration of images photoworks direct to get the best professional and Services Photo Restoration competent.\r\n\r\nOur technical experts working on your image restoration is well qualified in black an