(51, 1, '2014-07-09 11:26:36', '2014-07-09 11:26:36', '<p><a href=\"http://photoworksdirect.com/blog/wp-content/uploads/2014/09/xg.jpg\"><img class=\"aligncenter  wp-image-33\" alt=\"photo restoration\" src=\"http://photoworksdirect.com/blog/wp-content/uploads/2014/09/xg.jpg\" width=\"677\" height=\"380\" /></a>We are very proud of the work we are doing for photo restoration. Over the years we have built a loyal customer base. From their feedback we understand that the results we provided are life changing for many. Photo restoration continues to be our main source of business. We focus on the initial thought is to focus on photo restoration, image restoration or repair of the picture<br />\nAll of our<a title=\" photo restoration services\" href=\"http://www.photoworksdirect.com/\"> photo restoration services</a> are covered by our 100% guarantee and you will not be billed until you are completely satisfied with the work on your photo. Price categories listed below will give you an idea of the typical costs you can expect. Please keep in mind that it is impossible to accurately quote a photo recovery, photo retouching or photo archiving project, not even seeing the condition of the original image. We will not act without first providing you with a quote and confirmation as to what work you want to do. You can also be assured that we will never change the original.<br />\n<a href=\"http://photoworksdirect.com/blog/wp-content/uploads/2014/03/PHOTO-RESTORATION.jpg\"><img class=\"aligncenter size-full wp-image-16\" alt=\"Photo Restoration\" src=\"http://photoworksdirect.com/blog/wp-content/uploads/2014/03/PHOTO-RESTORATION.jpg\" width=\"527\" height=\"380\" /></a><br />\nRestoration Process<br />\nOnce the photo is scanned and evaluated, it\'s cropped to specify the working areas. Any \"obvious\" problems such as spots, tears, holes, cracks, fading, stains and scratches are removed. The overall color and contrast is usually altered as well. All of these steps are taken to present a clean and clear working photograph.<br />\nImage manipulation programs such as Adobe Photoshop are usually used to patch, \"heal\" and clone certain spots of the photo. The program (usually) knows how to automatically identify problem areas. Using the built-in tools usually mean you\'ll need to work around with them a lot, trying different things out until you get the desired effect.<br />\nFrom there we will touch up the details using some of the tools in our digital manipulation program, trying to match it as close as we can to the original. A photo that\'s restored to the likeness of the original will be not only free of defects, but it\'ll be colorized correctly (and free from fading), it will be of a high resolution, and it will be clean. Check out some of our digitally restored photos below!</p>\n<p><!--[if gte mso 9]><xml><br />\n <w:WordDocument><br />\n  <w:View>Normal</w:View><br />\n  <w:Zoom>0</w:Zoom><br />\n  <w:TrackMoves/><br />\n  <w:TrackFormatting/><br />\n  <w:PunctuationKerning/><br />\n  <w:ValidateAgainstSchemas/><br />\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid><br />\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent><br />\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText><br />\n  <w:DoNotPromoteQF/><br />\n  <w:LidThemeOther>EN-US</w:LidThemeOther><br />\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian><br />\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript><br />\n  <w:Compatibility><br />\n   <w:BreakWrappedTables/><br />\n   <w:SnapToGridInCell/><br />\n   <w:WrapTextWithPunct/><br />\n   <w:UseAsianBreakRules/><br />\n   <w:DontGrowAutofit/><br />\n   <w:SplitPgBreakAndParaMark/><br />\n   <w:EnableOpenTypeKerning/><br />\n   <w:DontFlipMirrorIndents/><br />\n   <w:OverrideTableStyleHps/><br />\n  </w:Compatibility><br />\n  <m:mathPr><br />\n   <m:mathFont m:val=\"Cambria Math\"/><br />\n   <m:brkBin m:val=\"before\"/><br />\n   <m:brkBinSub m:val=\"&#45;-\"/><br />\n   <m:smallFrac m:val=