(53, 1, '2014-10-09 11:26:36', '2014-10-09 11:26:36', '<a href=\"http://photoworksdirect.com/blog/wp-content/uploads/2014/09/xg.jpg\"><img class=\"aligncenter  wp-image-33\" alt=\"photo restoration\" src=\"http://photoworksdirect.com/blog/wp-content/uploads/2014/09/xg.jpg\" width=\"677\" height=\"380\" /></a>We are very proud of the work we are doing for photo restoration. Over the years we have built a loyal customer base. From their feedback we understand that the results we provided are life changing for many. Photo restoration continues to be our main source of business. We focus on the initial thought is to focus on photo restoration, image restoration or repair of the picture\r\nAll of our<a title=\" photo restoration services\" href=\"http://www.photoworksdirect.com/\"> photo restoration services</a> are covered by our 100% guarantee and you will not be billed until you are completely satisfied with the work on your photo. Price categories listed below will give you an idea of the typical costs you can expect. Please keep in mind that it is impossible to accurately quote a photo recovery, photo retouching or photo archiving project, not even seeing the condition of the original image. We will not act without first providing you with a quote and confirmation as to what work you want to do. You can also be assured that we will never change the original.\r\n<a href=\"http://photoworksdirect.com/blog/wp-content/uploads/2014/03/PHOTO-RESTORATION.jpg\"><img class=\"aligncenter size-full wp-image-16\" alt=\"Photo Restoration\" src=\"http://photoworksdirect.com/blog/wp-content/uploads/2014/03/PHOTO-RESTORATION.jpg\" width=\"527\" height=\"380\" /></a>\r\nRestoration Process\r\nOnce the photo is scanned and evaluated, it\'s cropped to specify the working areas. Any \"obvious\" problems such as spots, tears, holes, cracks, fading, stains and scratches are removed. The overall color and contrast is usually altered as well. All of these steps are taken to present a clean and clear working photograph.\r\nImage manipulation programs such as Adobe Photoshop are usually used to patch, \"heal\" and clone certain spots of the photo. The program (usually) knows how to automatically identify problem areas. Using the built-in tools usually mean you\'ll need to work around with them a lot, trying different things out until you get the desired effect.\r\nFrom there we will touch up the details using some of the tools in our digital manipulation program, trying to match it as close as we can to the original. A photo that\'s restored to the likeness of the original will be not only free of defects, but it\'ll be colorized correctly (and free from fading), it will be of a high resolution, and it will be clean. Check out some of our digitally restored photos below!\r\n\r\n<!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:EnableOpenTypeKerning/>\r\n   <w:DontFlipMirrorIndents/>\r\n   <w:OverrideTableStyleHps/>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val=\"Cambria Math\"/>\r\n   <m:brkBin m:val=\"before\"/>\r\n   <m:brkBinSub m:val=\"&#45;-\"/>\r\n   <m:smallFrac m:val=\"off\"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val=\"0\"/>\r\n   <m:rMargin m:val=\"0\"/>\r\n   <m:defJc m:val=\"centerGroup\"/>\r\n   <m:wrapInden