 repair. The next step is to optimize the contrast of the image. Use the Alt / Option button for Photoshop to repeat contrast setting.</p>\r\n<a href=\"http://photoworksdirect.com/blog/wp-content/uploads/2015/09/retouch1.jpg\"><img class=\"size-full wp-image-95 aligncenter\" alt=\"retouch1\" src=\"http://photoworksdirect.com/blog/wp-content/uploads/2015/09/retouch1.jpg\" width=\"749\" height=\"511\" /></a>Once you are done with the settings, it\'s time to go into detail. This is where you begin the process of restoration, enlarge the image and see for any damage that needs to be addressed. As already mentioned, a common problem that you overcome, while the restoration of an old image with wear and tear, dust, wrinkles and stretch. And all damages mentioned above can be repaired. For example, if you have a crack in the picture, you can use Clone Stamp tool in Photoshop to remove and enhance the image. It is advisable to zoom the image to get a good view of the affected area.\r\n\r\nBy using the clone stamp tool, you must copy the nearest similar pixels and fill the damaged area. During the production of this type of photo restoration, you should always start with the edges and then work your way toward the center and gradually moved to the end. Another important thing to keep in mind when restoring damaged pictures, to change the sample when covering more tear to ensure an even and consistent tone and shading. However, there is no need to worry about the straight edge at the top of your picture as you will be cropping.\r\n\r\nFor more about <b>Photo Restoration</b> <b>UK </b>- http://www.photoworksdirect.com/services/photo-restoration.html', 'Tips to Restore Your Damaged Photos ', '', 'inherit', 'closed', 'open', '', '92-revision-v1', '', '', '2015-09-21 09:07:23', '2015-09-21 09:07:23', '', 92, 'http://photoworksdirect.com/blog/92-revision-v1/', 0, 'revision', '', 0),
(104, 1, '2015-10-16 11:58:28', '2015-10-16 11:58:28', '<a href=\"http://photoworksdirect.com/blog/wp-content/uploads/2015/10/bubble.jpg\"><img class=\"aligncenter size-full wp-image-105\" alt=\"bubble\" src=\"http://photoworksdirect.com/blog/wp-content/uploads/2015/10/bubble.jpg\" width=\"460\" height=\"288\" /></a>We can capture some spectacular images by high-speed photography, but it requires a great deal of preparation, precision and patience. There are a few technical challenges to overcome, particularly when it comes to timing, and its very much a case of trial and error  but its also great fun!\r\n\r\nFor taking an amazing photograph of a bursting bubble, welluse a camera-mounted flashgun and remote shutter release. Once youve fix the exposure and timing you can experiment with different backdrops to create a variety of effects.\r\n\r\n<strong>Location and set-up</strong>\r\n\r\nFind asuitable location, such as a garden, ceiling window floor or a bathroom, asa fair amount of water will be involved. This provides lots of natural light and some pleasing, natural colors for the backdrop. Youll need tobe able to hang a backdrop and a water balloon in front of it. Leave some space between the bubbles and the window to reduce any reflections or glare that you may get from the glass.\r\n\r\n<strong>Use Large Bubbles</strong>\r\n\r\nLarger soap bubbles are easier to burst and will be easier for you to focus on than small bubbles. Larger bubbles stayed in the air long enough to capture them being burst. Smaller wands tended to produce streams of little bubbles which were difficult to burst and cluttered up the final shot. Use kids bubble toy set that came with a bubble wand of around 5cm in diameter.\r\n\r\n<a href=\"http://photoworksdirect.com/blog/wp-content/uploads/2015/10/bubbles.jpg\"><img class=\"aligncenter size-full wp-image-106\" alt=\"bubbles\" src=\"http://photoworksdirect.com/blog/wp-content/uploads/2015/10/bubbles.jpg\" width=\"573\" height=\"370\" /></a><strong>Camera settings</strong>\r\n\r\nPlace your camera on a tripod and set it to Manual mode. Set a narrow aperture of f/11 tocapture a broad depth of field, so that you can get asmuch of the action as possible in focus. Use a zoom lens when you shooting bubbles. So we can adjust the focal length as necessary to focus and compose the shot while the bubble is in mid-air. Set your shutter speed to 1/200 sec to sync with the flashgun, and keep the ISO at 100 for maximum image quality.\r\n\r\n<strong>Focus Manually </strong>\r\n\r\n<a href=\"http://photoworksdirect.com/blog/wp-content/uploads/2015/10/focus.jpg\"><img class=\"aligncenter size-full wp-image-107\" alt=\"focus\" src=\"http://photoworksdirect.com/blog/wp-content/uploads/2015/10/focus.jpg\" width=\"610\" height=\"407\" /></a>Focus manually on the bubble floating in mid-air and pressed the shutter release button as soon as the bubble was to be burst.\r\n\r\n<strong>Keep calm and carry on</strong>\r\n\r\nYou may take a few attempts to get the right shot of bubble bursts. Keep patience and dont give up on the challenge. Get someone to pop the balloon while you fire the shutter. Keep going, your final image will be much more satisfying.\r\n<p style=\"text-align: center;\"><a href=\"http://photoworksdirect.com/blog/wp-content/uploads/2015/10/bubbled.jpg\"><img class=\"aligncenter size-full wp-image-108\" alt=\"bubbled\" src=\"http://photoworksdirect.com/blog/wp-content/uploads/2015/10/bubbled.jpg\" width=\"672\" height=\"450\" /></a></p>', 'How to Capture a Photo of a Bubble Bursting', '', 'publish', 'closed', 'open', '', 'how-to-capture-a-photo-of-a-bubble-bursting', '', '', '2015-10-16 11:58:41', '2015-10-16 11:58:41', '', 0, 'http://photoworksdirect.com/blog/?p=104', 0, 'post', '', 0),
